import React from 'react';
import './css/Photo.css';

// Sample image URLs, replace these with actual image paths or URLs
const images = [
  'path/to/photo1.jpg',
  'path/to/photo2.jpg',
  'path/to/photo3.jpg',
  // Add more images as needed
];

const Photographs = () => {
  return (
    <div className="photographs-container">
      <div className="cards">
        <ul>
          {images.map((image, index) => (
            <li key={index} className="photo-card">
              <img src={image} alt={`Photo ${index + 1}`} />
              <p>Description for photo {index + 1}</p>
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default Photographs;
